import Card from '../UI/Car';
import classes from './AvailableMeals.module.css';
const DUMMYMEALS = [
	{
		id: 'm1',
		name: 'Sushi',
		descrpition: 'Finest fish and veggies',
		price: 22.99,
	},
	{
		id: 'm2',
		name: 'Schnitzel',
		descrpition: 'A german speciality!',
		price: 16.5,
	},
	{
		id: 'm3',
		name: 'Barbecue Burger',
		descrpition: 'American, raw, meaty',
		price: 12.99,
	},
	{
		id: 'm4',
		name: 'Green Bowl',
		descrpition: 'Healthy and green',
		price: 18.99,
	},
];

const AvailableMeals = () => {
	const mealsList = DUMMYMEALS.map((meal) => <li>{meal.name}</li>);
	return (
		<section className={classes.meals}>
			<ul className={classes.meals}>{mealsList}</ul>
		</section>
	);
};
export default AvailableMeals;
